import React from 'react';
import { Text, TouchableOpacity } from 'react-native';
import style from '../Calculadora/styleCalculadora';

export default function Button(props) {
    return (
        <TouchableOpacity
            style={[style.button, style.buttonAmarelo]}
            onPress={
                () => operacao(props.operador)
            }
        >
            <Text style={style.text}>{props.operador}</Text>
        </TouchableOpacity>

    );
}
